biography:
There are several artists artists using the name "Max";

1) "Max" is Max Schneider, signed to DCD2. He released Mug Shot and The Say Max - EP in 2014. Gibberish (feat. Hoodie Allen) was released in 2015. His song "Lights Down Low" peaked at #20 on the Hot 100 in 2018.

2)  "MAX", which is short for Musical Active eXperience, is a Japanese pop group. Original members Mina, Reina, Lina and Nana formed MAX from their original group ,SUPER MONKEY'S in 1995 and released their debut single in May of that year. https://www.last.fm/music/MAX

Born in Osijek on 28th of March 1948. He started his singing career with Osijek's pop groups and his solo career was marked by song "Plavuša" (eng. Blonde:P). Nowadays he sings on festivals, winner of many awards, he often goes on tours for Croatian diaspora. He is a succesfull hit composer, founder of "tambura" band "Bećari" with whom he entertains and fosters original melodies of Croatian people.


