Rođen u Osijeku 28.03.1948. S pjevanjem je započeo u Osiječkim pop grupama a solističku karijeru obilježila mu je skladba Plavuša. https://www.last.fm/music/krunoslav+ki%C4%87o+slabinac

There are numerous artists with this name, including: 
1) Alba is Franco-Mexican pop singer Alba-Clara Hinojosa; 
2) Alba is a Corsican band; 
3) Alba is a Danish medieval music ensemble founded in 1992; 
4) Alba is Italian entertainer Alba Parietti; 
5) Alba was a Scottish folk group active in the 1970s; 
6) Alba was a German electro trio of Keen K, Michael Künzer, and Roland Faber; 
7) ALBA is Spanish singer, guitarist and songwriter Alba Céspedes;  https://www.last.fm/music/Alba

There are more than one act called Meduza:

1. Meduza are an Italian production trio consisting of Luca de Gregorio, Mattia Vitale and Simone Giani. They are known for their 2019 breakthrough song "Piece of Your Heart" which was a collaboration with British production trio Goodboys. Meduza have created a melodic, yet energetic sound, set to be the climactic point in Ibiza's ever thriving tale of upfront musical taste making;

2. Meduza is a punk /rock band from Oslo, Norway. https://www.last.fm/music/Meduza
